!transitions.equals(Transitions.NONE) ? new TransitionsOutputFormatterCallback(configuredTargetQueryEnvironment.getAccessor(),transitions,env.getReporter().getOutErr().getOutputStream(),env.getSkyframeExecutor(),hostConfiguration) : new ThreadSafeOutputFormatterCallback<ConfiguredTarget>(){
  @Override public void processOutput(  Iterable<ConfiguredTarget> partialResult) throws IOException, InterruptedException {
    for (    ConfiguredTarget configuredTarget : partialResult) {
      BuildConfiguration config=configuredTarget.getConfiguration();
      StringBuilder output=new StringBuilder().append(ConfiguredTargetQueryEnvironment.getCorrectLabel(configuredTarget)).append(" (").append(config != null && config.isHostConfiguration() ? "HOST" : config).append(")");
      env.getReporter().getOutErr().printOutLn(output.toString());
    }
  }
}

